    and other data were collected from the CHAIN in the North Atlantic and other locations
    from 08 December 1958 to 16 April 1968. Data include profiles of temperature, salinity,
    pH, and rates of primary production. Data also include concentration profiles of
    oxygen, particulate organic carbon, phosphate, total phosphate, nitrate, nitrite,
    silicate, ammonia, and chlorophyll a. Data were submitted by the Woods Hole Oceanographic
    Institute (WHOI) and are in a comma separated value (.csv) format.",nt"owner_org":
